INSERT INTO QUESTION_RESPONSE(ID, CREATED_BY, DATE_CREATED, DATE_VALUE, DOCUMENT_ID, FLOAT_VALUE, FORM_FIELD_ID, LAST_UPDATED, STRING_VALUE, UPDATED_BY) VALUES (33, 'bulkload', to_timestamp('15-OCT-12','DD-MON-RR HH.MI.SSXFF AM'), null, 2, null, 5, to_timestamp('15-OCT-12','DD-MON-RR HH.MI.SSXFF AM'), 'The purpose of this gateway installation is to replace an existing gateway at Alta View Hospital which is used to send patient vital signs data from the existing GE Medical Systems clinical patient monitors to the hospital patient information system. In other words, it provides the means for auto-charting the patient-related physiological vital signs data rather than for the clinical staff having to manually enter it into their clinical workstations thus saving the clinical staff precious time. This GE system has existed for years at AVH and LDSH with gateways that we are just now upgrading.\r\nThe scope of this project is just to replace the existing gateway with a new gateway. Both the old and new gateways have and will exist on the GE Medical Systems LAN at AVH which is totally separate and isolated from the hospital LAN/WAN, the gateway being the only link between the two networks. We are not installing a new non-standard network, we are just replacing one component of an existing third-party isolated medical network. The network components of the GE Medical Network are specified by GE and provided by them in accordance with their FDA 510K approvals for these systems which they and we are required to adhere to. These type of systems exist throughout the corporation for both GE and Philips patient monitoring medical networks.', 'bulkload');
